import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Queue from './categories/queue.jsx';
import InProgress from './categories/inProgress.jsx';
import Done from './categories/done.jsx';
import Card from './categories/card.jsx';


/* Syles */

const catWrapperDivStyle = {
  display: 'grid',
  gridTemplateColumns: '1fr 1fr 1fr'
};

const catDivStyle = {
  display: 'grid',
  // padding: '100px',
  // height: '900px'
  borderRight: '1px solid gray',
  borderLeft: '1px solid white',
  borderBottom: '1px solid white'
};

const pCatStyle = {
  fontFamily: 'Geneva',
  fontSize: '16px',
  textAlign: 'center',
  color: 'gray'
};

const progressCardStyles = {
  display: 'grid'
};

const items = {
  display: 'grid'
};


/* End Syles */


class inProgress extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [
          {
            id: 1,
            description: 'Make Better Styles.',
            priority: 'Medium',
            by: 'Jon',
            to: 'Renee'
          },
          {
            id: 2,
            description: 'Make Better Styles. Make Better Styles. Make Better Styles. Make Better Styles. Make Better Styles. Make Better Styles.',
            priority: 'Medium',
            by: 'Jon',
            to: 'Renee'
          }
      ]
    }
  }

  render() {    
    const Section = () => (
        <div style={catWrapperDivStyle}>

        <div>
        <p style={pCatStyle}>IN PROGRESS</p>  
        <div style={catDivStyle}>
          <div style={progressCardStyles}>
              {this.state.items.map( item => <div style={items}>{item.description}</div> )}
            </div>
        </div>
        </div>

      </div>
    );


    return (
      <div>
        <div className="Components">
          <Section />
        </div>
      </div>
    );
  }
}



export default inProgress;
